import React from './node_modules/react';

import Category from '../../components/MenuItem';
import { sections } from './directory.data';

const HomePage = () => {
  const renderedCategories = sections.map((section) => {
    return (
      <>
        <Category section={section} key={section.id} />
      </>
    );
  });
  return <div>{renderedCategories}</div>;
};

export default HomePage;
